PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "config_global_categoryteacher" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "config_global_echelon" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "config_global_grade" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "config_global_ladder" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "config_global_personalclass" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "config_global_speciality" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "config_global_departement" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE, "ordering" smallint unsigned NOT NULL UNIQUE CHECK ("ordering" >= 0), "longitude" real NULL, "latitude" real NULL, "country_id" bigint NULL REFERENCES "config_global_country" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "config_global_country" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE, "ordering" smallint unsigned NOT NULL UNIQUE CHECK ("ordering" >= 0), "longitude" real NULL, "latitude" real NULL, "nationality_label" varchar(255) NOT NULL, "flag" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "config_global_bundle" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL, "label" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "config_global_town" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE, "ordering" smallint unsigned NOT NULL UNIQUE CHECK ("ordering" >= 0), "longitude" real NULL, "latitude" real NULL, "country_id" bigint NOT NULL REFERENCES "config_global_country" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "academic_years_academicyear" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "date_created" datetime NOT NULL, "year_name" varchar(10) NOT NULL UNIQUE, "year_begin" smallint NOT NULL, "year_end" smallint NOT NULL, CONSTRAINT "unique_year_academic" UNIQUE ("year_begin", "year_end"));
CREATE TABLE IF NOT EXISTS "agent_agent" ("user_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "last_modified" datetime NOT NULL, "civility" varchar(10) NOT NULL, "birth_date" date NOT NULL, "contact" varchar(30) NOT NULL, "qrcode_img" text NULL, "quality" varchar(50) NULL, "birth_city_id" bigint NOT NULL REFERENCES "config_global_town" ("id") DEFERRABLE INITIALLY DEFERRED, "box_id" bigint NULL REFERENCES "config_global_box" ("id") DEFERRABLE INITIALLY DEFERRED, "category_id" bigint NULL REFERENCES "config_global_categoryteacher" ("id") DEFERRABLE INITIALLY DEFERRED, "echelon_id" bigint NULL REFERENCES "config_global_echelon" ("id") DEFERRABLE INITIALLY DEFERRED, "grade_id" bigint NULL REFERENCES "config_global_grade" ("id") DEFERRABLE INITIALLY DEFERRED, "ladder_id" bigint NULL REFERENCES "config_global_ladder" ("id") DEFERRABLE INITIALLY DEFERRED, "nationality_id" bigint NOT NULL REFERENCES "config_global_country" ("id") DEFERRABLE INITIALLY DEFERRED, "personal_class_id" bigint NULL REFERENCES "config_global_personalclass" ("id") DEFERRABLE INITIALLY DEFERRED, "speciality_id" bigint NULL REFERENCES "config_global_speciality" ("id") DEFERRABLE INITIALLY DEFERRED, "town_residence_id" bigint NOT NULL REFERENCES "config_global_town" ("id") DEFERRABLE INITIALLY DEFERRED, "Detained_dependent_child" real NOT NULL, "basic_salary" real NOT NULL, "monthly_indaminitis" real NOT NULL, "retained_cnss" real NOT NULL, "retained_insurance" real NOT NULL, "retained_other" real NOT NULL, "retained_social_case" real NOT NULL, "adress" varchar(255) NULL, "cityArea" varchar(255) NULL, "photo" text NULL, "created_by_id" integer NULL REFERENCES "agent_agent" ("user_ptr_id") DEFERRABLE INITIALLY DEFERRED, "last_modified_by_id" integer NULL REFERENCES "agent_agent" ("user_ptr_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "config_global_box" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(20) NOT NULL, "label" varchar(255) NOT NULL, "max_withdrawal_per_period" real NOT NULL, "max_withdrawal_per_transaction" real NOT NULL, "max_withdrawal_period" real NOT NULL, "payment_authorized" bool NOT NULL, "withdrawal_authorized" bool NOT NULL, "inter_cash_transfer_authorized" bool NOT NULL, "cash_balance" bool NOT NULL, "bank_withdrawal_transfer_authorized" bool NOT NULL, "is_actif" bool NOT NULL, "academic_year_id" bigint NOT NULL REFERENCES "academic_years_academicyear" ("id") DEFERRABLE INITIALLY DEFERRED, "chart_of_account_id" bigint NOT NULL REFERENCES "config_global_chartofaccount" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "config_global_chartofaccount" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL, "label" varchar(200) NOT NULL, "credit_balance" real NOT NULL, "debit_balance" real NOT NULL, "senc_dc" varchar(20) NULL, "is_chapter" bool NULL, "clase_number" integer NOT NULL, "credit_bundle_id" bigint NULL REFERENCES "config_global_bundle" ("id") DEFERRABLE INITIALLY DEFERRED, "debit_bundle_id" bigint NULL REFERENCES "config_global_bundle" ("id") DEFERRABLE INITIALLY DEFERRED, "academic_year_id" bigint NOT NULL REFERENCES "academic_years_academicyear" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teacher_teacher" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cityArea" varchar(255) NULL, "adress" varchar(255) NULL, "photo" text NULL, "last_modified" datetime NOT NULL, "civility" varchar(10) NOT NULL, "birth_date" date NOT NULL, "contact" varchar(30) NOT NULL, "qrcode_img" text NULL, "quality" varchar(50) NULL, "birth_city_id" bigint NOT NULL REFERENCES "config_global_town" ("id") DEFERRABLE INITIALLY DEFERRED, "category_id" bigint NULL REFERENCES "config_global_categoryteacher" ("id") DEFERRABLE INITIALLY DEFERRED, "echelon_id" bigint NULL REFERENCES "config_global_echelon" ("id") DEFERRABLE INITIALLY DEFERRED, "grade_id" bigint NULL REFERENCES "config_global_grade" ("id") DEFERRABLE INITIALLY DEFERRED, "ladder_id" bigint NULL REFERENCES "config_global_ladder" ("id") DEFERRABLE INITIALLY DEFERRED, "nationality_id" bigint NOT NULL REFERENCES "config_global_country" ("id") DEFERRABLE INITIALLY DEFERRED, "personal_class_id" bigint NULL REFERENCES "config_global_personalclass" ("id") DEFERRABLE INITIALLY DEFERRED, "speciality_id" bigint NULL REFERENCES "config_global_speciality" ("id") DEFERRABLE INITIALLY DEFERRED, "town_residence_id" bigint NOT NULL REFERENCES "config_global_town" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "created_by_id" bigint NULL REFERENCES "teacher_teacher" ("id") DEFERRABLE INITIALLY DEFERRED, "last_modified_by_id" bigint NULL REFERENCES "teacher_teacher" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "reporting_userdocument" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(250) NOT NULL, "description" varchar(250) NULL, "content" text NOT NULL, "type_user" smallint NOT NULL, "date_save" datetime NOT NULL, "last_update_date" datetime NOT NULL, "added_by_id" integer NOT NULL REFERENCES "agent_agent" ("user_ptr_id") DEFERRABLE INITIALLY DEFERRED, "last_update_by_id" integer NOT NULL REFERENCES "agent_agent" ("user_ptr_id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "year_id" bigint NOT NULL REFERENCES "academic_years_academicyear" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "academic_years_academicyear_users" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "academicyear_id" bigint NOT NULL REFERENCES "academic_years_academicyear" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "config_global_branch" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE, "order" smallint NULL, "speciality_id" bigint NOT NULL UNIQUE REFERENCES "config_global_speciality" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "config_global_nivel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE, "order" smallint NULL, "examen_nivel" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "config_global_nivel_branchs" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nivel_id" bigint NOT NULL REFERENCES "config_global_nivel" ("id") DEFERRABLE INITIALLY DEFERRED, "branch_id" bigint NOT NULL REFERENCES "config_global_branch" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "config_global_classroom" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL UNIQUE, "label" varchar(50) NOT NULL UNIQUE, "order" smallint NULL, "branch_id" bigint NOT NULL REFERENCES "config_global_branch" ("id") DEFERRABLE INITIALLY DEFERRED, "nivel_id" bigint NOT NULL REFERENCES "config_global_nivel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "review_review" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(500) NOT NULL, "logo" text NULL, "editorial_slint" text NOT NULL, "editorial_slint_pdf" text NOT NULL, "code" varchar(20) NOT NULL, "date_created" datetime NOT NULL, "last_update" datetime NOT NULL, "author_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "is_active" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "review_typesource" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "review_volume" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "index" smallint NOT NULL, "date_created" datetime NOT NULL, "last_update" datetime NOT NULL, "year" varchar(4) NOT NULL, "pages_count" smallint NULL, "review_id" bigint NOT NULL REFERENCES "review_review" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_index_by_review" UNIQUE ("review_id", "index"), CONSTRAINT "unique_year_by_review" UNIQUE ("review_id", "year"));
